import Sushi from '../Meals/Sushi';
const Menu = (props) => {
  const [menuOpen, setMenuOpen] = useState(false);
  const handleMenuClick = () => {
    setMenuOpen(!menuOpen);
  };
  return (
    <nav>
      <ul>
        <li>
          Sushi
          <Link
            path="/Sushi"
            element={
              <div id="content-wrap" style={{ float: 'right', width: '75%' }}>
                <Sushi />
              </div>
            }
          />
        </li>
        <li>
          Bevande
          <Link
            path="/Drinks"
            element={
              <div id="content-wrap" style={{ float: 'right', width: '75%' }}>
                <Drinks />
              </div>
            }
          />
        </li>
      </ul>
    </nav>
  );
};
